DROP TABLE IF EXISTS `file_services`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `file_services` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL,
  `tuning_type_id` int(11) unsigned NOT NULL,
  `make` varchar(191) NOT NULL,
  `model` varchar(191) NOT NULL,
  `generation` varchar(191) NOT NULL,
  `engine` varchar(191) NOT NULL,
  `ecu` varchar(191) DEFAULT NULL,
  `fuel_type` varchar(191) DEFAULT NULL,
  `engine_hp` varchar(191) DEFAULT NULL,
  `year` year(4) NOT NULL,
  `gearbox` varchar(191) NOT NULL,
  `license_plate` varchar(191) DEFAULT NULL,
  `vin` varchar(191) DEFAULT NULL,
  `orginal_file` varchar(191) DEFAULT NULL,
  `modified_file` varchar(191) DEFAULT NULL,
  `note_to_engineer` varchar(191) DEFAULT NULL,
  `notes_by_engineer` text DEFAULT NULL,
  `status` enum('O','W','C') NOT NULL DEFAULT 'O' COMMENT '''O''=>''open'',''W''=>''waiting'',''C''=>''completed''',
  `displayable_id` bigint(20) unsigned NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE current_timestamp(),
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `tuning_type_id` (`tuning_type_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `file_services_ibfk_1` FOREIGN KEY (`tuning_type_id`) REFERENCES `tuning_types` (`id`) ON DELETE CASCADE,
  CONSTRAINT `file_services_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1768 DEFAULT CHARSET=latin1;
