INSERT INTO `slider_managers` VALUES (1,'ECU Remapping File Portal Service.','If you are a file producer who needs a centralised cloud based portal for your clients you are in the right place','1562667539.PNG','Interested ?','mailto:sales@myremaps.com?subject=I\'m Interested in a MyRemaps File Portal','2019-06-23 23:00:00','2019-07-11 08:22:18'),(2,'Customise in seconds','Change the colour scheme - add your own logo and you are up and running in seconds','1562665527.PNG','Want a Demo ?','mailto:sales@myremaps.com?subject=I\'m Interested in a MyRemaps  Demo','2019-06-23 23:00:00','2019-07-11 08:22:58'),(3,'Saves time and Money','Designed by tuners for tuners to make your file service a pleasure, not a chore.  Simple intuitive interface. Built in file storage, ticket support system and automated invoicing to your clients. Designed to save you time in the day','1562667485.jpg','Contact us','mailto:sales@myremaps.com?subject=I\'m Interested in a MyRemaps File Portal','2019-07-02 18:48:56','2019-07-11 08:23:14'),(4,'1 Fixed fee - no hidden costs','Unlike similar file portals, you pay ponly 1 fixed monthly or yearly fee. We do not charge you for each file processed through the server and all updates are free!','1562669191.jpg',NULL,NULL,'2019-07-09 09:07:28','2019-07-09 09:46:31'),(5,'Client Uploads the original File','Uploads direct to your portal. All Originals and Mod files are stored safe in the cloud. You are in full control','1572876311.PNG',NULL,NULL,'2019-11-04 13:49:23','2019-11-04 14:05:11'),(6,'Credits','Set Multiple Different Credit Prices','1572875644.PNG',NULL,NULL,'2019-11-04 13:54:04','2019-11-04 13:54:04'),(7,'Customise Email Notifications','Your portal takes care of all the email notifications to your customer automatically','1572875837.PNG',NULL,NULL,'2019-11-04 13:57:17','2019-11-04 13:57:17'),(8,'Master download the original file','The Master Tuner downloads the original for modification.  All the information he needs is displayed','1572876632.PNG',NULL,NULL,'2019-11-04 14:10:32','2019-11-04 14:10:32'),(9,'After Modification','The master uploads the MOD file and changes status to completed, click save and job done ! the client receives an email notification','1572876716.PNG',NULL,NULL,'2019-11-04 14:11:56','2019-11-04 14:11:56'),(10,'Original and Mod Files Stored in the Cloud,','Available to download anytime in the future, making it simple to get the full job details if you need to go back to it','1572876835.PNG',NULL,NULL,'2019-11-04 14:13:55','2019-11-04 14:13:55'),(11,'Automatic or Manual Credit Handling','You can add and remove credits for a client quick and easy Manually or they can buy with PayPal linked to your own account','1572877085.PNG',NULL,NULL,'2019-11-04 14:18:05','2019-11-04 14:18:05');
